import React from "react";
import * as myProjectService from "../../services/myProjectService";

import { Card, CardBody, CardFooter, Row, Col } from "reactstrap";

import CardAuthor from "components/CardElements/CardAuthor.jsx";
// import FormInputs from "components/FormInputs/FormInputs.jsx";
// import Button from "components/CustomButton/CustomButton.jsx";

import damirBosnjak from "assets/img/damir-bosnjak.jpg";

class ProfileCard extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      myProject: []
    };
  }

  componentDidMount() {
    console.log("mounted");
    myProjectService
      .getAllProfiles()
      .then(this.onGetAllSuccess)
      .catch(this.onError);
  }

  onGetAllSuccess = response => {
    console.log("successful get all profiles");
    // debugger;
    this.setState({
      myProject: response.data.items
    });

    console.log(response.data.items);
  };

  onError = () => {
    console.log("get all profiles error");
  };

  render() {
    return (
      <React.Fragment>
        <div className="content">
          <Row>
            {/* <React.Fragment key={yoga.id}> */}
            {/* <div className="content"> */}
            {/* <Row> */}
            <Col md={4}>
              <Card className="card-user">
                <div className="image">
                  <img src={damirBosnjak} alt="..." />
                </div>
                <CardBody>
                  <CardAuthor
                    avatar={this.state.myProject.image}
                    avatarAlt="..."
                    title={
                      this.state.myProject.firstName +
                      " " +
                      this.state.myProject.lastName
                    }
                    // description="@chetfaker"
                  />
                  {/* Name: {yoga.firstName} {yoga.lastName} */}
                  <p className="description text-center">
                    {" "}
                    Certifications: {this.state.myProject.certifications}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Specializations: {this.state.myProject.specializations}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Yoga Style: {this.state.myProject.yogaStyle}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Rates: {this.state.myProject.rates}
                  </p>
                  <p className="description text-center">
                    {" "}
                    Location: {this.state.myProject.location}
                  </p>

                  <p className="description text-center">
                    Bio: {this.state.myProject.bio}
                  </p>
                </CardBody>
                {/* <p className="description text-center"> Website: </p> */}
                <hr />
                <Col lg={12} className="mr-auto   text-center">
                  <h7>
                    Website:
                    <br />
                    <small>{this.state.myProject.website}</small>
                  </h7>
                </Col>

                <CardFooter>
                  <hr />
                  <div className="button-container">
                    <Row>
                      <Col xs={6} sm={6} md={6} lg={6} className="ml-auto">
                        {/* <Col xs={6} sm={6} md={6} lg={3} className="ml-auto"> */}
                        <h7>
                          Email:
                          <br />
                          <small>{this.state.myProject.email}</small>
                        </h7>
                      </Col>
                      <Col
                        xs={6}
                        sm={6}
                        md={6}
                        lg={4}
                        className="mr-auto ml-auto"
                      >
                        <h7>
                          Phone:
                          <br />
                          <small>{this.state.myProject.phone}</small>
                        </h7>
                      </Col>
                    </Row>
                  </div>
                </CardFooter>
              </Card>
            </Col>
          </Row>
        </div>
      </React.Fragment>
    );
  }
}

export default ProfileCard;
